            $("g[data-id] text").each(function () {
                $(this).attr("data-title", $(this).text());
            });

            var apiRead=function(){
                $.post("{{url('api/shakemap_event_api')}}", {}, function(src) {
                    $("[data-id]").removeAttr("style").each(function(){
                        // $(this).find("polyline").removeAttr("class");
                        $(this).find("text").attr("class","text");
                    });
                    if(src.type=="event"){
                        var maxPGAIndex=0;
                        for(var i in src.data){
                            if(src.data[i].PGA*1.0>src.data[maxPGAIndex].PGA*1.0){
                                maxPGAIndex=i;
                            }
                            //
                            $("[data-id='"+src.data[i].id+"']").find("text").each(function(){
                                $(this).text($(this).attr("data-title")+"(PGA:"+src.data[i].PGA+")");
                            });
                            //
                            $("[data-id='"+src.data[i].id+"']").each(function(){
                                if(src.data[i].PGA<=0.8){
                                    fillColor="#999999";
                                }else if(src.data[i].PGA<=2.5){
                                    fillColor="#98f0ff";
                                }else if(src.data[i].PGA<=8.0){
                                    fillColor="#528eff";
                                }else if(src.data[i].PGA<=25){
                                    fillColor="#05e600";
                                }else if(src.data[i].PGA<=80){
                                    fillColor="#fff316";
                                }else if(src.data[i].PGA<=250){
                                    fillColor="#ffa85d";
                                }else if(src.data[i].PGA<=400){
                                    fillColor="#f75f5f";
                                }else{
                                    fillColor="#a04de6";
                                }
                                $(this).css({
                                    "fill":fillColor
                                });
                            });
                        }
                        //
                        console.log(src.data[maxPGAIndex].PGA);
                        $("[data-id='"+src.data[maxPGAIndex].id+"']").each(function(){
                            // $(this).find("polyline").attr("class","active");
                            $(this).find("text").attr("class","text active");
                            $(this).find("circle").click();//attr("class","text active");
                        })
                    }else{
                        for(var i in src.data){
                            $("[data-id='"+src.data[i].id+"']").find("text").each(function(){
                                $(this).text($(this).attr("data-title")+"("+src.data[i].scale+")");
                            });
                        }
                    }
                    // setTimeout(apiRead, 1500);
                },"json");
            };
            apiRead();
        })(document)
